package com.zenith.livinghistory.api.zenithlivinghistoryapi.request;import java.io.Serializable;public class AnnotationTarget implements Serializable {    /*    * Example:    *    * "target": {    *   "id": "http://example.com/image1.jpg#xywh=100,100,300,300",    *   "type": "Image",    *   "format": "image/jpeg"    * }    *    * */    private String id;    private String type;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }}